import React from 'react';
import Reg from './componentsReg/Reg';
import Regp from './componentsReg/Regp';
import './Register.css';

export default class Register extends React.Component {
  state = {
    register: [],
  };

  Reg = (em, ps) => {
    const newList = {
      email: em,
      password: ps,
      id: this.newId++,
    };
    this.setState(({ login }) => {
      const myLastTodo = [...login, newList];
      return { login: myLastTodo };
    });
  };
  render() {
    const { register } = this.state;
    return (
      <div className='register'>
        <Reg Reg={this.Reg} />
        <div className='item'>
          {register.map((item2) => {
            return <Regp {...item2} />;
          })}
        </div>
      </div>
    );
  }
}
